webpackJsonp([0xd51c4f8ebdef],{568:function(A,S){A.exports={data:{pages:{internal:{content:'{"id":11,"title":"Building Block B: Design","slug":"building-blocks/design","template":"buildingBlock.jsx","category":"building_block"}'},childPagesContent:{internal:{content:'{"header":{"image":"data:image/jpeg;base64,","title":"Building Block B","subtitle":"Design","range_title":"left"},"body":{"0":{"type":"section","content":{"0":{"text":"Background","type":"header"},"1":{"text":"<p>Ideally, project teams will undertake the design phase after having completed the activities in Building Block A: Analysis. This sequencing allows project teams to use their analytical findings to identify and design effective, strategic and child-sensitive PA programmes that tackle the root causes of child deprivations.&nbsp;</p>\\n<p>Even if project teams have not completed the analysis steps in Building Block A, it is still possible to design child sensitive PA programmes. In particular, Action Step 4: Identify and plan to address risk and assumptions and Action Step 5: Consolidate child-sensitive design, are free standing activities. Also, in the case that a PA project is already underway, the action steps presented in Building Block B: Design can help project teams to modify existing PA modalities to ensure that they maximize positive outcomes for children. For example, even if a programme is in its final phase(s), it is still possible for project teams to integrate child-sensitivity into the final evaluation by identifying the possible risks and unintended negative outcomes for children using action steps presented in this Building Block.&nbsp;</p>\\n<p>Building Block B presents three action steps (and corresponding tools) for designing child-sensitive PA programmes. These are:&nbsp;</p>\\n<h4>Design Action 3: Identify potential solutions&nbsp;</h4>\\n<ul>\\n<li>Tool 3.1: Objective Tree&nbsp;</li>\\n</ul>\\n<h4>Design Action 4: Identify and plan to address risks and assumptions&nbsp;</h4>\\n<ul>\\n<li>Tool 4.1: Risk and Assumption Matrix and Accompanying Guide&nbsp;</li>\\n<li>Tool 4.2: Risk Plot&nbsp;&nbsp;</li>\\n</ul>\\n<h4>Design Action 5: Consolidate child-sensitive design&nbsp;</h4>\\n<ul>\\n<li>Tool 5.1: Theory of Change Model&nbsp;&nbsp;</li>\\n</ul>\\n","type":"paragraph"}}},"1":{"type":"section","content":{"0":{"text":"Actions","type":"header"},"1":{"text":"<p><a href=\\"/actions/3\\" target=\\"_self\\">Action 3: Identify Potential Solutions</a>&nbsp;</p>\\n<p><a href=\\"/actions/4\\" target=\\"_self\\">Action 4: Identify and Plan to Address Risks and Assumptions</a>&nbsp;</p>\\n<p><a href=\\"/actions/5\\" target=\\"_self\\">Action 5: Consolidate Child-Sensitive Design</a>&nbsp;</p>\\n","type":"paragraph"}}}}}'
}}}},pathContext:{slug:"building-blocks/design"}}}});
